full_text:
Si dice: il governo Meloni venga giudicato dai fatti.

I primi provvedimenti del governo:
- via le mascherine da ospedali e RSA;
- via il tetto all’uso del contante;
- rinvio della riforma su giustizia penale con rischi per il PNRR.

Non proprio le urgenze di stipendi e bollette.

